export const styles = {
  inputs: {
    display: "flex",
  },

  price: {
    width: "272px",
  },

  date: {
    width: "192px",
  },

  title: {
    fontSize: "14px",
  },

  input: {
    height: "56px",
    border: "1px solid #E9EEF2",
    borderRadius: "4px",
  },
  currency: {
    border: "1px inset #ccc",
  },
};
